import { CButtonGroup, CButtonToolbar } from "@coreui/react";
import CButton from "src/Components/UI/Button/Button";

const SButtonGroup = (props) => {
  return (
    <CButtonGroup className="mr-2">
      <CButton
        color="dark"
        width="30%"
        type="submit"
        name={props.color}
        block={false}
        width="30%"
      />
      <CButton
        color="danger"
        width="30%"
        type="submit"
        name="X"
        block={false}
        width="30%"
        onClick
      />
    </CButtonGroup>
  );
};
export default SButtonGroup;
